std::optional<const DecodedInstruction> Decode(std::uint64_t inst, std::uint64_t sched) {
  for (const auto& entry : sDecodingTable) {
    if ((inst & entry.instMask) == entry.instValue && (sched & entry.schedMask) == entry.schedValue) {
      if (entry.restrictions == nullptr || entry.restrictionCount == 0)
        return std::make_optional<const DecodedInstruction>(inst, sched, entry.opcode, entry.opclass);
      if (std::all_of(entry.restrictions, entry.restrictions + entry.restrictionCount, [=](const auto& restriction) {
        const std::uint32_t value = static_cast<std::uint32_t>(restriction.ReadFunc(sched ? restriction.isSched : inst));
        return std::any_of(restriction.validRanges, restriction.validRanges + restriction.rangeCount, [=](const auto& range) {
          return value - range.min < range.max - range.min;
        });
      })) {
        return std::make_optional<const DecodedInstruction>(inst, sched, entry.opcode, entry.opclass);
      }
    }
  }
  return std::nullopt;
}

#define TABLE_LOOKUP(table, ...) \
std::optional<std::tuple<__VA_ARGS__>> table(std::uint64_t value) { \
  const auto res = std::lower_bound(s ## table.begin(), s ## table.end(), value, [](const auto& entry, std::uint64_t value) { \
    return entry.first < value; \
  }); \
  return res == s ## table.end() ? std::nullopt : std::make_optional<std::tuple<__VA_ARGS__>>(res->second); \
}
